/**
 * Created by za on 2019/10/13.
 */

'use strict'
import React, {Component} from 'react'
import ReactDOM from "react-dom";
import Navig from "./register";

class Navigator extends Component {
    constructor(props) {
        super(props);
        this.state = {
            navName: props.navName,
            navUrl: props.navUrl,
        }
    }

    render() {
        return (
            <div>
                <a href={this.state.navUrl}>{this.state.navName}</a>
            </div>
        )
    }
}

function Nav() {
    return(
        <ul>
            <li><Navigator navName="index" navUrl="index.html"/></li>
            <li><Navigator navName="register" navUrl="register.html"/></li>
            <li><Navigator navName="index3" navUrl="#"/></li>
        </ul>
    )
}

const nav = Nav()
const navig = Navig()

ReactDOM.render(
    nav,
    document.getElementById("navigator")
)

ReactDOM.render(
    navig,
    document.getElementById("na")
)
